import React, { ReactElement } from "react";

interface BlocksType {
  text: string;
  description: string;
  margin: string;
}

const Blocks = (props: BlocksType): ReactElement => {
  // implement onClick functionality (think <button>)
  return (
    <>
      <div className="center-contents" style={{ margin: `${props.margin}`, height: "10em", width: "14em", backgroundColor: "#E0E0E0", display: "flex", flexDirection: "column" }}>
        <div className="default-div" style={{ backgroundColor: "transparent", marginBottom: "0.7em", fontSize: "2em" }}>{props.text}</div>
        <div className="default-div" style={{ backgroundColor: "transparent" }}>{props.description}</div>
      </div>
    </>
  );
}

export default Blocks;
